use hex::FromHex;

/// Palette has 64 colors, each color has 3 bytes (RGB).
pub static PALETTE_COLORS: usize = 64;

/// Each color has 3 bytes (RGB).
pub static RGB_SIZE: usize = 3;

/// Palette has 64 colors, each color has 3 bytes (RGB). Total bytes: 64 * 3 = 192.
pub static PALETTE_BYTES: usize = PALETTE_COLORS * RGB_SIZE;

